import "./Navbar.css";

export default function Navbar() {
  return (
    <div className="Navbar">
      <h1>LUCKBRC</h1>
      <h3>Twitter</h3>
      <h3>Discord</h3>
      <h3>Unisat</h3>
      <h3>Gate</h3>
      <h3>Telegram</h3>
    </div>
  );
}
